import React, { useState } from 'react';

const AddUserForm = () => {
  const [userData, setUserData] = useState({
    userID: '',
    userName: '',
    birthday: '',
    email: '',
    phone: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUserData({ ...userData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('http://localhost:8080/add-user', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(userData)
      });

      if (response.ok) {
        console.log('User added successfully');
        // Reset form fields
        setUserData({
          name: '',
          age: '',
          birthday: '',
          email: '',
          phone: ''
        });
      } else {
        console.error('Error adding user:', response.statusText);
      }
    } catch (error) {
      console.error('Error adding user:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" name="name" placeholder="Name" value={userData.name} onChange={handleChange} />
      <input type="text" name="age" placeholder="Age" value={userData.age} onChange={handleChange} />
      <input type="text" name="birthday" placeholder="Birthday" value={userData.birthday} onChange={handleChange} />
      <input type="text" name="email" placeholder="Email" value={userData.email} onChange={handleChange} />
      <input type="text" name="phone" placeholder="Phone" value={userData.phone} onChange={handleChange} />
      <button type="submit">Add User</button>
    </form>
  );
};

export default AddUserForm;
